import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress,
    MDBListGroup,
    MDBListGroupItem
} from "mdbreact";
import { useHistory } from "react-router";
import { Chart } from "react-google-charts";
import "./style.css"
import ApexCharts from 'apexcharts';
import Charts from "react-apexcharts";
export const Home = (props: any) => {
    const token = localStorage.getItem("token");
    const [chartoptions, setChartoptions] = useState({
        options: {
            chart: {
              id: "bar",
              height: 50
            },
            xaxis: {
              categories: ["Critical", "High", "Low"]
            },
            colors: ['#f44336', '#ff9800', '#2bbbad', '#13d8aa', '#A5978B', '#2b908f', '#f9a3a4', '#90ee7e',
            '#f48024', '#69d2e7'
          ],
          dataLabels: {
            enabled: false,

          },
          plotOptions: {
            bar: {
              distributed: true,
            }
          }
          },
          series: 
            [{
              name: "series-1",
              data: [30, 40, 45],
            }]

    });
    console.log(props)
    if (token === null || token === undefined || token.length <0) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }
    return (
        <>
            <MDBContainer fluid className="pt-5 pb-5" style={{ padding: "2vw" }}>
                <MDBRow >
                <Charts
              options={chartoptions.options}
              series={chartoptions.series}
              type="bar"
              width="500"
            />

                </MDBRow>
            </MDBContainer>
        </>
    )
}
